import RecipeDetails from "./pages/details";


function App() {
  return (
     <RecipesProvider>
       <Router>

      <div className="App">
        <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        {/* <Route path="/details/:mealId" element={<RecipeDetails />}/> */}

      </Routes>
      </div>
       </Router>
     </RecipesProvider>


  );
}

export default App;
